/* eslint-disable prettier/prettier */
import { Button, Col, Empty, Row } from 'antd';
import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';

import { useDispatch, useSelector } from 'react-redux';
import SubAdminTable from './SubAdminTable';
import { PageHeader } from '../../components/page-headers/page-headers';
import { CardToolbox, Main } from '../styled';
import { AutoComplete } from '../../components/autoComplete/autoComplete';
import { getListAdvertisement } from '../../redux/advertisement/actionCreator';
import { getListSubAdmin } from '../../redux/subAdmin/actionCreator';
import { Cards } from '../../components/cards/frame/cards-frame';




const ListSubAdmin = () => {

    const { listSubAdmin } = useSelector(state => state.SubAdmin);

    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getListSubAdmin(1, 5))
    }, [dispatch]);

    return (
        <>
            <CardToolbox>
                <PageHeader
                    ghost
                    title="List Sub Admin"
                    subTitle={
                        <>
                            <AutoComplete
                                placeholder="Search by Name"
                                width="100%"
                                onkeyup={value => {
                                    dispatch(loadingStart())
                                    value.length !== 0 ? dispatch(serchAdvertisement(value)) : dispatch(getListAdvertisement(1, 5))
                                }}
                                patterns
                            />
                        </>
                    }
                    buttons={[
                        <Button className="btn-add_new" size="default" type="primary" key="1">
                            <Link to="/admin/addSubAdmin">+ Add New Sub Admin</Link>
                        </Button>
                    ]}
                />
            </CardToolbox>

            <Main>
                <Row gutter={15}>
                    <Col md={24}>
                        {listSubAdmin && listSubAdmin.length > 0 ? (
                            <SubAdminTable data={listSubAdmin} />
                        ) : <Cards Cards caption="The simplest use of Empty">
                            <Empty />
                        </Cards>}
                    </Col>
                </Row>
            </Main>
        </>
    );
};

export default ListSubAdmin;
